/**
 * Gets the class name from a class.
 *
 * @export
 * @param {Function} clazz
 * @returns {string}
 */
export declare function ClassName(clazz: any): string;
/**
 * @description Returns a list of the class methods.
 *
 * @export
 * @param {*} clazz
 * @returns {Array<any>}
 */
export declare function ClassMethods(clazz: any): Array<any>;
